import { Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './components/Header';
import Slider from './components/Slider';
import ferstImg from '../public/img/first.jpeg'



function App() {
  return (
    <div>
      <Header></Header>
      <Slider></Slider>
      <img src={ferstImg}></img>
    <Button variant='primary'>
        Кнопка
    </Button>
     <Button variant="outline-danger">Light</Button>
     </div>
  );
}

export default App;
